import React from 'react';
import 'normalize.css';
import List from './List';

const StylesForDiv: any = {
    display: 'flex'
}

const StylesForList: any = {
    backgroundColor: 'red'
}

const App = (): any => {
  return (
    <div style = {StylesForDiv}>
        <List />
        <List />
        <List />
    </div>
  );
}

export default App;
